import React from 'react';

const SlotM = ()=>{
  let x = ':smile';
  let y = ':smile';
  let z = ':smile';

  if((x===y)&& (y==z)){
    return(
      <>
      <div className="slot_inner">
        <h1>{x} {y} {z} </h1>
        <h1>This is Matching.</h1>
        <hr />
      </div>
      </>
    )
  }else{
    return (
      <>
      <div className="slot_inner">
        <h1>{x} {y} {z} </h1>
        <h1>This is Not Matching.</h1>
        <hr />
      </div>
      </>
    )
  }
}

const App = ()=>{
   return(
     <>
     <h1 style={{marginBottom:'2rem'}} className="heading_style">Welocome to <apan style={{fontWeight:'bold',backgroundColor:' rgb(192, 190, 190)',color:'#000',fontWeight:'400',fontSize:'4rem'}}>Slot machine game</apan></h1>
     <SlotM />
     </>
   )
}

export default App;
